import { View, Text, Pressable, Image } from "react-native";
import React from "react";
import Ionicons from "react-native-vector-icons/Ionicons";
import FontAwesomeIcons from "react-native-vector-icons/FontAwesome5";

const PersonalSetting = ({ navigation }) => {
  navigation.setOptions({
    headerRight: () => (
      <View style={{ flexDirection: "row", paddingHorizontal: 16 }}>
        <Pressable style={{ paddingHorizontal: 2 }}>
          <Ionicons name="search" size={24} color="white" />
        </Pressable>
      </View>
    ),
    headerTitle: () => (
      <View style={{ flexDirection: "row", alignItems: "center" }}>
        <Text style={{ color: "white", fontSize: 20, fontWeight: "bold" }}>
          Cài đặt
        </Text>
      </View>
    ),
    headerStyle: {
      backgroundColor: "#0091FF",
      shadowColor: "#fff",
    },
    headerTintColor: "#fff",
    headerTitleStyle: {
      fontWeight: "bold",
      fontSize: 20,
    },
  });
  return (
    <View>
      {/* View select */}

      {/* Tài khoản và bảo mật*/}
      <Pressable
        onPress={() => {
          navigation.navigate("AccountVsSecurity");
        }}
        style={{
          backgroundColor: "white",
          flexDirection: "row",
          alignItems: "center",
          height: 60,
        }}
      >
        <View style={{ width: "16.666%", alignItems: "center" }}>
          <Ionicons name="shield-checkmark-outline" size={22} color="#0091FF" />
        </View>
        <View style={{ width: "66.666%" }}>
          <Text style={{ fontWeight: "bold", fontSize: 16 }}>
            Tài khoản và bảo mật
          </Text>
        </View>
        <Ionicons name="arrow-forward" size={24} color="#cccccc" />
      </Pressable>

      {/* Quyền riêng tư */}
      <Pressable
        onPress={() => {
          navigation.navigate("PersonalPrivacy");
        }}
        style={{
          backgroundColor: "white",
          flexDirection: "row",
          alignItems: "center",
          height: 60,
          marginBottom: 2,
        }}
      >
        <View style={{ width: "16.666%", alignItems: "center" }}>
          <Ionicons name="lock-closed-outline" size={22} color="#0091FF" />
        </View>
        <View style={{ width: "66.666%" }}>
          <Text style={{ fontWeight: "bold", fontSize: 16 }}>
            Quyền riêng tư
          </Text>
        </View>
        <Ionicons name="arrow-forward" size={24} color="#cccccc" />
      </Pressable>

      {/* Dung lượng dữ liệu */}
      <Pressable
        style={{
          backgroundColor: "white",
          flexDirection: "row",
          alignItems: "center",
          height: 80,
        }}
      >
        <View style={{ width: "16.666%", alignItems: "center" }}>
          <Ionicons name="pie-chart-outline" size={24} color="#0091FF" />
        </View>
        <View style={{ width: "66.666%", height: "75%" }}>
          <Text style={{ fontWeight: "bold", fontSize: 16, paddingBottom: 5 }}>
            Dung lượng dữ liệu
          </Text>
          <Text style={{ color: "gray", fontWeight: "medium" }}>
            Quản lý dữ liệu Zalo của bạn
          </Text>
        </View>
        <Ionicons name="arrow-forward" size={24} color="#cccccc" />
      </Pressable>

      {/* Bộ nhớ */}
      <Pressable
        style={{
          backgroundColor: "white",
          flexDirection: "row",
          alignItems: "center",
          height: 80,
          marginBottom: 2,
        }}
      >
        <View style={{ width: "16.666%", alignItems: "center" }}>
          <Ionicons name="cloudy-outline" size={24} color="#0091FF" />
        </View>
        <View style={{ width: "66.666%" }}>
          <Text style={{ fontWeight: "bold", fontSize: 16 }}>
            Sao lưu và khôi phục
          </Text>
          <Text style={{ color: "gray", fontWeight: "medium" }}>
            Bảo vệ tin nhắn khi đổi máy hoặc cài lại Zalo
          </Text>
        </View>
        <Ionicons name="arrow-forward" size={24} color="#cccccc" />
      </Pressable>

      {/* Thông báo*/}
      <Pressable
        style={{
          backgroundColor: "white",
          flexDirection: "row",
          alignItems: "center",
          height: 60,
        }}
      >
        <View style={{ width: "16.666%", alignItems: "center" }}>
          <FontAwesomeIcons name="bell" size={22} color="#0091FF" />
        </View>
        <View style={{ width: "66.666%" }}>
          <Text style={{ fontWeight: "bold", fontSize: 16 }}>Thông báo</Text>
        </View>
        <Ionicons name="arrow-forward" size={24} color="#cccccc" />
      </Pressable>

      {/* Tin nhắn*/}
      <Pressable
        style={{
          backgroundColor: "white",
          flexDirection: "row",
          alignItems: "center",
          height: 60,
        }}
      >
        <View style={{ width: "16.666%", alignItems: "center" }}>
          <Ionicons name="chatbubble-outline" size={22} color="#0091FF" />
        </View>
        <View style={{ width: "66.666%" }}>
          <Text style={{ fontWeight: "bold", fontSize: 16 }}>Tin nhắn</Text>
        </View>
        <Ionicons name="arrow-forward" size={24} color="#cccccc" />
      </Pressable>

      {/* Cuộc gọi*/}
      <Pressable
        style={{
          backgroundColor: "white",
          flexDirection: "row",
          alignItems: "center",
          height: 60,
        }}
      >
        <View style={{ width: "16.666%", alignItems: "center" }}>
          <Ionicons name="call-outline" size={22} color="#0091FF" />
        </View>
        <View style={{ width: "66.666%" }}>
          <Text style={{ fontWeight: "bold", fontSize: 16 }}>Cuộc gọi</Text>
        </View>
        <Ionicons name="arrow-forward" size={24} color="#cccccc" />
      </Pressable>

      {/* Nhật ký*/}
      <Pressable
        style={{
          backgroundColor: "white",
          flexDirection: "row",
          alignItems: "center",
          height: 60,
        }}
      >
        <View style={{ width: "16.666%", alignItems: "center" }}>
          <FontAwesomeIcons name="clock" size={22} color="#0091FF" />
        </View>
        <View style={{ width: "66.666%" }}>
          <Text style={{ fontWeight: "bold", fontSize: 16 }}>Nhật ký</Text>
        </View>
        <Ionicons name="arrow-forward" size={24} color="#cccccc" />
      </Pressable>

      {/* Danh bạ*/}
      <Pressable
        style={{
          backgroundColor: "white",
          flexDirection: "row",
          alignItems: "center",
          height: 60,
        }}
      >
        <View style={{ width: "16.666%", alignItems: "center" }}>
          <FontAwesomeIcons name="address-book" size={22} color="#0091FF" />
        </View>
        <View style={{ width: "66.666%" }}>
          <Text style={{ fontWeight: "bold", fontSize: 16 }}>Danh bạ</Text>
        </View>
        <Ionicons name="arrow-forward" size={24} color="#cccccc" />
      </Pressable>

      {/* Giao diện và ngôn ngữ*/}
      <Pressable
        style={{
          backgroundColor: "white",
          flexDirection: "row",
          alignItems: "center",
          height: 60,
          marginBottom: 2,
        }}
      >
        <View style={{ width: "16.666%", alignItems: "center" }}>
          <Ionicons name="color-palette-outline" size={22} color="#0091FF" />
        </View>
        <View style={{ width: "66.666%" }}>
          <Text style={{ fontWeight: "bold", fontSize: 16 }}>
            Giao diện và ngôn ngữ
          </Text>
        </View>
        <Ionicons name="arrow-forward" size={24} color="#cccccc" />
      </Pressable>

      {/* Thông tin về Zalo*/}
      <Pressable
        style={{
          backgroundColor: "white",
          flexDirection: "row",
          alignItems: "center",
          height: 60,
        }}
      >
        <View style={{ width: "16.666%", alignItems: "center" }}>
          <Ionicons
            name="information-circle-outline"
            size={22}
            color="#0091FF"
          />
        </View>
        <View style={{ width: "66.666%" }}>
          <Text style={{ fontWeight: "bold", fontSize: 16 }}>
            Thông tin về Zalo
          </Text>
        </View>
        <Ionicons name="arrow-forward" size={24} color="#cccccc" />
      </Pressable>

      {/* Liên hệ hỗ trợ*/}
      <Pressable
        style={{
          backgroundColor: "white",
          flexDirection: "row",
          alignItems: "center",
          height: 60,
          marginBottom: 2,
        }}
      >
        <View style={{ width: "16.666%", alignItems: "center" }}>
          <Ionicons name="help-circle-outline" size={22} color="#0091FF" />
        </View>
        <View style={{ width: "66.666%" }}>
          <Text style={{ fontWeight: "bold", fontSize: 16 }}>
            Liên hệ hỗ trợ
          </Text>
        </View>
        <Pressable
          style={{
            backgroundColor: "#ccc",
            padding: 4,
            borderRadius: 20,
            marginRight: 10,
          }}
        >
          <Ionicons
            name="chatbubble-ellipses-outline"
            size={18}
            color="black"
          />
        </Pressable>
      </Pressable>

      {/* Chuyển tài khoản*/}
      <Pressable
        style={{
          backgroundColor: "white",
          flexDirection: "row",
          alignItems: "center",
          height: 60,
        }}
      >
        <View style={{ width: "16.666%", alignItems: "center" }}>
          <Ionicons name="sync-circle-outline" size={22} color="#0091FF" />
        </View>
        <View style={{ width: "66.666%" }}>
          <Text style={{ fontWeight: "bold", fontSize: 16 }}>
            Chuyển tài khoản
          </Text>
        </View>
        <Ionicons name="arrow-forward" size={24} color="#cccccc" />
      </Pressable>

      <Pressable
        style={{
          backgroundColor: "#ccc",
          flexDirection: "row",
          alignItems: "center",
          justifyContent: "center",
          height: 60,
          width: "90%",
          borderRadius: 20,
          alignSelf: "center",
          marginBottom: 20,
        }}
      >
        <View style={{ alignItems: "center", paddingHorizontal: 8 }}>
          <Ionicons name="exit-outline" size={22} color="black" />
        </View>
        <View style={{ paddingHorizontal: 8 }}>
          <Text style={{ fontWeight: "bold", fontSize: 16 }}>Đăng xuất</Text>
        </View>
      </Pressable>
    </View>
  );
};

export default PersonalSetting;
